import React from 'react';
import './StyleOfButtons.css'

const ListOfButtons = ()=>{
    return <div className='ButtonList'>
       <button className='Buttons'><p>Saved Message</p></button>
       <button className='Buttons'><p>Saved Message</p></button>
    </div>
}

export default ListOfButtons;
